import React, { useEffect } from 'react';
import './calendar.css';

const Calendarday = () => {   
    const DAYS = ["SUN","MON","TUE","WED","THU","FRI","SAT"];

    let days=[];
    for (let i = 0; i < 7; i++) {
      days.push(
        <div className="col col-center" key={i}>
          {DAYS[i]}
        </div>
      );
    }

    return <div className="days row">{days}</div>;
  }

  export default Calendarday;
